INSERT INTO `v1_8129bff7206a00666efca27c1868704b2e546bd5bd1bd447fa549ba2cf73f571` VALUES (2, "青空の下で謁見", 91002, 0, 1, 40, 0, "ペコリーヌとの出会い", 5118061, "フリーマーケット会場", 10118, "フリーマーケットを訪れたジータが出会ったのは\n城をこっそり抜け出していたペコリーヌだった。", 8, 7, 2834);
INSERT INTO `v1_8129bff7206a00666efca27c1868704b2e546bd5bd1bd447fa549ba2cf73f571` VALUES (2, "未来の騎空団\nマスコット？", 91002, 0, 1, 40, 0, "マホとの出会い", 5118062, "フリーマーケット会場", 10118, "ジータたちがフリーマーケットを巡っていると\n露店を出していたマホに声をかけられる。", 8, 7, 2835);
INSERT INTO `v1_8129bff7206a00666efca27c1868704b2e546bd5bd1bd447fa549ba2cf73f571` VALUES (2, "お嬢さまからの\n緊急依頼", 91002, 0, 1, 40, 0, "アキノとの出会い", 5118063, "ランドソル市街地", 10118, "ジータが騎空団への依頼を確認していると、\n高笑いをしながらアキノが現れる。", 8, 7, 2837);
INSERT INTO `v1_8129bff7206a00666efca27c1868704b2e546bd5bd1bd447fa549ba2cf73f571` VALUES (2, "黄金色の悩みごと", 91002, 0, 1, 40, 0, "ジュンとの出会い", 5118064, "フリーマーケット会場", 10118, "ジータたちは、フリーマーケット会場で\n少し困った様子のジュンを見かける。", 8, 18, 4108402);
INSERT INTO `v1_8129bff7206a00666efca27c1868704b2e546bd5bd1bd447fa549ba2cf73f571` VALUES (2, "白熱！　格闘大会！", 91002, 0, 1, 40, 0, "カオリとの出会い", 5118065, "フリーマーケット会場", 10118, "フリーマーケットの隅で開かれる格闘大会──\nそこにはカオリもいて……？", 8, 18, 4107402);
INSERT INTO `v1_8129bff7206a00666efca27c1868704b2e546bd5bd1bd447fa549ba2cf73f571` VALUES (2, "祭り太鼓はオーエドの華", 91002, 1, 1, 40, 0, "ニノンとの出会い", 5118066, "オーエド町", 10118, "太鼓祭を控えるオーエド町──\nジータは、困った様子のニノンと出会う。", 8, 16, 9000227);
INSERT INTO `v1_8129bff7206a00666efca27c1868704b2e546bd5bd1bd447fa549ba2cf73f571` VALUES (3, "人気者は遅れて\nやってくる", 91002, 0, 1, 40, 0, "スズナとの出会い", 5118067, "フリーマーケット会場", 10118, "ビカラはイベントに出演中のスズナを見かける。\nしかし、スズナはどこか困っているようで……？", 8, 19, 2101181);
INSERT INTO `v1_8129bff7206a00666efca27c1868704b2e546bd5bd1bd447fa549ba2cf73f571` VALUES (3, "巫女・ミーツ・魔法少女", 91002, 0, 1, 40, 0, "ナナカとの出会い", 5118068, "ランドソル市街地", 10118, "ビカラたちが街を散策していると、通りかかった\nナナカが興奮した様子で近づいてきて……？", 8, 18, 4109402);
INSERT INTO `v1_8129bff7206a00666efca27c1868704b2e546bd5bd1bd447fa549ba2cf73f571` VALUES (3, "ネズ耳は二度なくなる", 91002, 0, 1, 40, 0, "キャル＆コッコロとの出会い", 5118069, "フリーマーケット会場", 10118, "ネズ耳をなくしてしまい絶望するビカラ。同じ頃\nキャルとコッコロは落とし物を拾っており……", 8, 18, 4305402);
INSERT INTO `v1_8129bff7206a00666efca27c1868704b2e546bd5bd1bd447fa549ba2cf73f571` VALUES (3, "この出会いにカンパイ！", 91002, 0, 1, 40, 0, "ユカリとの出会い", 5118070, "ランドソル市街地", 10118, "街外れでひと休みをしていたビカラたちは、\nすっかりゴキゲンな様子のユカリと出会う。", 8, 18, 4101402);
INSERT INTO `v1_8129bff7206a00666efca27c1868704b2e546bd5bd1bd447fa549ba2cf73f571` VALUES (3, "陰陽アンサンブル", 91002, 0, 1, 40, 0, "アオイとの出会い", 5118071, "ランドソル市街地", 10118, "ビカラは、人混みに怯えるアオイを心配し、\n陽気に声をかけるも……", 8, 18, 4106402);
INSERT INTO `v1_8129bff7206a00666efca27c1868704b2e546bd5bd1bd447fa549ba2cf73f571` VALUES (3, "運試し十番勝負！", 91002, 1, 1, 40, 0, "シノブとの出会い", 5118072, "フリーマーケット会場", 10118, "ビカラがフリーマーケット会場を歩いていると\n占いをしていたシノブに声をかけられる。", 8, 7, 2836);
INSERT INTO `v1_8129bff7206a00666efca27c1868704b2e546bd5bd1bd447fa549ba2cf73f571` VALUES (1, "彼女たちの新たな日常", 0, 0, 0, 0, 10145115, "オープニング", 5118600, 0, 10118, 0, 0, 0, 0);
